import './NextviewportMenu.css';


const scroll =()=>{
    document.addEventListener("DOMContentLoaded", function() {
        const button = document.getElementById("scrollButton");
        const section2 = document.getElementById("fashioninformationbox");
      
        button.addEventListener("click", function() {
          section2.scrollIntoView({ behavior: 'smooth' });
        });
      });
}

const NextviewportMenu = () =>{
    return(
        <ul className="next-viewport-menu">
            <li onClick={scroll} id="scrollButton"></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
        </ul>
    );
}
export default NextviewportMenu
